import "./"

function App() {
  return (
    <div>

      {/* navigation bar and intro */}
        <Navbar/>
        <IntroComp/>
      {/* end */}

      <Tranding/>


      {/* footer */}
      <Footer/>

    </div>
  );
};

export default App;
